@Override
public int nextDoc() throws IOException {
  doc++;
  while(liveDocs != null && doc < maxDoc && !liveDocs.get(doc)) {
    doc++;
  }
  if (doc == maxDoc) {
    doc = NO_MORE_DOCS;
  }
  return doc;
}

